import React, { Component } from "react";
import Navbar from "./Navbar/Navbar";
import "./RegisterInfo.css";
import RegisterStorage from "./stores/RegisterStorage";
import swal from "sweetalert2";

class RegisterInfo extends Component {
  constructor(props) {
    super(props);
    this.state = {
      password: "",
      fname: "",
      lname: "",
      dob: "",
      gender: "",
      email: "",
      username: "",
    };
    this.onChange = this.onChange.bind(this);
  }
  showtext() {
    var date = document.getElementById("email");
    console.log(date.innerHTML);
    date.type = "date";
    if (date.textContent === "") {
      console.log(date);
      date.type = "text";
    } else date.type = "date";
  }

  onChange(e) {
    this.setState({ [e.target.name]: e.target.value });
  }

  setInputValue(property, val) {
    val = val.trim();
    if (val.length > 15) {
      return;
    }
    this.setState({
      [property]: val,
    });
  }

  pwstrength() {
    var password = document.getElementById("password").value;
    document.getElementById("pwmsg").style.visibility = "visible";
    var bar = document.getElementById("strength");
    var val = bar.value;
    bar.style.visibility = "visible";
    console.log(password.length);
    bar.low = "0.45";
    bar.high = "0.75";
    bar.optimum = "0.8";
    if (password.length < 6) {
      bar.value = "0.3";
      bar.background = "red";
    } else if (password.length < 9) bar.value = "0.55";
    else bar.value = "0.8";
  }

  async doRegisterPost() {
    if (!this.state.password) return;

    try {
      let res = await fetch("http://localhost:3002/registerpost", {
        method: "post",
        headers: {
          Accept: "application/json",
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          password: this.state.password,
          username: this.state.username,
          fname: this.state.fname,
          lname: this.state.lname,
          dob: this.state.dob,
          gender: this.state.gender,
          email: this.state.email,
        }),
      });

      let result = await res.json();
      //console.log(res.json());
      if (result && result.success) {
        // let redirectVar = null;
        console.log("");
        swal.fire({
          icon: "success",
          title: "Verification Email Sent!",
          text: "Enter the OTP to verify your Email",
          type: "Success",
          confirmButtonText: "OK",
        });
        // notifier.notify({
        //     title: 'Verification Email Sent!',
        //     message: 'Enter the OTP to verify your Email',
        //     icon: 'dwb-logo.png',
        //     contentImage: 'blog.png',
        //     sound: 'ding.mp3',
        //     wait: true
        // });
        console.log("success");
        RegisterStorage.email = this.state.email;
        RegisterStorage.username = this.state.username;
        this.props.history.push("/verifyemail");
      } else if (result && result.success === false) {
        console.log("registration failed ");
        swal.fire({
          icon: "error",
          title: "Registration failed",
          text: "Try Again",
          confirmButtonText: "OK",
        });
        this.props.history.push("/RegisterInfo");
      }
    } catch (e) {}
  }

  render() {
    return (
      <div className="container">
        <Navbar />
        <div className="row">
          <div className="pitchline" id="pitch">
            <div id="Main">Online election perfection!</div>
            <div id="about">Our E-Voting solution is here for you.</div>
          </div>
        </div>
        <div className="row registerimage">
          <div className="qoutereg">
            <div className="h3" className="since-title">
              {" "}
              Help.Us.Help.You
              <br></br>
              Security & Trust
            </div>
          </div>
          <div className="overlayingreg col-md-6">
            <div className="regimage " id="reg">
              {" "}
            </div>

            <div className="resgitrationdetails">
              Create account
              {/* <form > */}
              {/* <div className="loginForm logindetails col-md-6"></div> */}
              <input
                type="text"
                className="registerclass"
                id="fname"
                value={this.state.fname}
                onChange={this.onChange}
                name="fname"
                placeholder="Please enter your first name"
                required
              ></input>
              <br></br>
              <input
                type="text"
                className="registerclass"
                id="lname"
                value={this.state.lname}
                onChange={this.onChange}
                name="lname"
                placeholder="Please enter your Last name"
                required
              ></input>
              <br></br>
              <input
                type="text"
                className="registerclass"
                id="email"
                value={this.state.email}
                onChange={this.onChange}
                name="email"
                placeholder="Please enter your Email"
                required
              ></input>
              <br></br>
              <input
                type="text"
                className="registerclass"
                id="username"
                value={this.state.username}
                onChange={this.onChange}
                name="username"
                placeholder="Please enter your username"
                required
              ></input>
              <br></br>
              <input
                type="password"
                value={this.state.password}
                onChange={this.onChange}
                className="registerclass"
                onInput={() => this.pwstrength()}
                id="password"
                name="password"
                placeholder="Please enter a password"
                required
              ></input>
              <br></br>
              <input
                type="date"
                placeholder="Please Enter your Date of Birth"
                // onFocus={this.type = 'date'}
                className="registerclass"
                value={this.state.date}
                onChange={this.onChange}
                id="dob"
                name="dob"
                placeholder="Please provide your DoB in mm/dd/yyyy format"
                required
              ></input>
              <br></br>
              <input
                type="list"
                value={this.state.gender}
                onChange={this.onChange}
                list="genderoptions"
                className="registerclass"
                id="gender"
                name="gender"
                placeholder="Please select your gender"
                required
              ></input>
              <datalist id="genderoptions">
                <option value="Female"></option>
                <option value="Male"></option>
              </datalist>
              {/* <br><br></br></br> */}
              <span className="pwdstrength" id="pwmsg">
                {" "}
                Password Strength:{" "}
              </span>
              <br></br>
              <meter className="meter " id="strength"></meter>
              <button
                className="rg"
                id="rg"
                onClick={() => this.doRegisterPost()}
              >
                Register
              </button>
              {/* </div> */}
              {/* </form> */}
            </div>
          </div>
        </div>

        <div className="row">
          <div className="reviews">
            <div className="reviewtitle">
              <div className=" h3 titlemessage">
                {" "}
                Straight from the horses mouth!{" "}
